"use strict";function getData(){fetch("https://jsonplaceholder.typicode.com/posts").then(function(t){return t.json()}).then(function(t){var e="<h2>Posts</h2>";t.forEach(function(t){e+="<div><h3>"+t.title+"</h3><p>"+t.body+"</p></div>"}),document.getElementById("output").innerHTML=e})}document.getElementById("getData").addEventListener("click",getData);